import { createActionTypes } from "../utils";

export const AppActions = createActionTypes("login", [
  "LOGIN_CLICKED"
]);

export const onLogin = (data) => ({
    type: AppActions.LOGIN_CLICKED,
    payload: {
      ...data
    }
  });
